import React from "react";
import { Container, Row, Col } from "react-bootstrap"; // Added import statement for Row and Col
import mylist from "./fetchmylist"; // Corrected import statement
import Product from "./Product";
import Footer from "./Footer"; // Added import statement for Footer

function MyList() {
    const mylistDetails = mylist();
    return (
        <>
            <Container>
                <br />
                <h1>Movies</h1>
                <Row>
                    {mylistDetails.map((product) => (
                        <Col key={product._id} sm={12} md={6} lg={4} xl={3}>
                            <Product product={product} />
                        </Col>
                    ))}
                </Row>
            </Container>
            <Footer /> {/* Include Footer component here */}
        </>
    );
}

export default MyList;
